function get_pmat(angle,a,min,max){
    var ang = Math.tan((angle*.5)*Math.PI/180);
    return [
        0.5/ang, 0 , 0 , 0,
        0, 0.5*a/ang, 0, 0,
        0, 0, -(max+min)/(max-min), -1,
        0, 0, (-2*max*min)/(max-min), 0];
}

